import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Swal from 'sweetalert2';
import './departement2.css';
import ProfileDropdown from './ProfileDropdown';

const Departement2 = () => {
  const [darkMode, setDarkMode] = useState(false);
  const [user, setUser] = useState({});
  const navigate = useNavigate();

  useEffect(() => {
    const token = sessionStorage.getItem('token');
    if (!token) {
      console.error('Token is missing');
      return;
    }

    const fetchUserData = async () => {
      const userId = sessionStorage.getItem('userId');
      if (!userId) {
        console.error('User ID is missing');
        return;
      }

      try {
        const response = await fetch(`http://localhost:8000/api/users/${userId}`, {
          headers: {
            'Authorization': 'Bearer ' + token,
          }
        });

        if (!response.ok) {
          throw new Error('Failed to fetch user data');
        }

        const user = await response.json();
        setUser(user);
        console.log(user);
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };

    fetchUserData();
  }, []);

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
    document.body.classList.toggle('dark-mode', !darkMode);
  };

  const navigateTo = (path) => {
    if (Object.keys(user).length === 0) {
      Swal.fire({
        icon: 'info',
        title: 'Chargement en cours...',
        text: 'Veuillez patienter.',
      });
      return;
    }

    navigate(path);
  };
  onst [dossiers, setDossiers] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8000/api/dossier")
      .then((response) => response.json())
      .then((data) => setDossiers(data))
      .catch((error) => console.error("Error fetching dossiers:", error));
  }, []);

  const handleAccuser = (id) => {
    Swal.fire({
      title: "Confirm Accuser",
      text: "Do you want to confirm sending the accuser?",
      icon: "warning",
      showCancelButton: true,
      confirmButtonText: "Yes, confirm it!",
    }).then((result) => {
      if (result.isConfirmed) {
        fetch(`http://localhost:8000/api/dossiers/${id}/accuser`, {
          method: "POST",
        })
          .then((response) => response.json())
          .then((data) => {
            Swal.fire("Confirmed!", "The accuser has been sent.", "success");
          })
          .catch((error) => {
            console.error("Error sending accuser:", error);
            Swal.fire("Error!", "An error occurred while sending the accuser.", "error");
          });
      }
    });
  };

  const handleEdit = (id) => {
    Swal.fire({
      title: "Edit Regime Douanier",
      input: "text",
      inputLabel: "Regime Douanier",
      inputPlaceholder: "Enter the regime douanier",
      showCancelButton: true,
      confirmButtonText: "Save",
    }).then((result) => {
      if (result.isConfirmed) {
        fetch(`http://localhost:8000/api/dossiers/${id}/regime_douanier`, {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({ regime_douanier: result.value }),
        })
          .then((response) => response.json())
          .then((data) => {
            Swal.fire("Saved!", "The regime douanier has been updated.", "success");
          })
          .catch((error) => {
            console.error("Error updating regime douanier:", error);
            Swal.fire("Error!", "An error occurred while updating the regime douanier.", "error");
          });
      }
    });
  };

  const handleDeclarant = (id) => {
    // Placeholder function for handling declarant selection
    // Implement this based on your declarant selection logic
    Swal.fire("Functionality not implemented", "This functionality needs to be implemented", "info");
  };


  const userRole = user.data?.role || [];

  return (
    <div id="page-container" className="sidebar-o sidebar-dark enable-page-overlay side-scroll page-header-fixed main-content-narrow">
      {/* Sidebar and header code remains the same */}
      <nav id="sidebar" aria-label="Main Navigation">
        {/* Sidebar content remains the same */}
        <div className="js-sidebar-scroll">
          <div className="content-side">
            <ul className="nav-main">
              <li className="nav-main-item">
                <a className="nav-main-link" href="be_pages_dashboard.html">
                  <i className="nav-main-link-icon si si-speedometer"></i>
                  <span className="nav-main-link-name">Dashboard</span>
                </a>
              </li>
              <li className="nav-main-heading">Departement opérations</li>
              {userRole.includes('Chef departement') && (
                <li className="nav-main-item">
                  <a className="nav-main-link" href="#!" onClick={() => navigateTo('/chef2')}>
                    <i className="nav-main-link-icon si si-energy"></i>
                    <span className="nav-main-link-name">Chef departement</span>
                  </a>
                </li>
              )}
              {(userRole.includes('Assistant departement') || userRole.includes('Chef departement')) && (
                <li className="nav-main-item">
                  <a className="nav-main-link" href="#!" onClick={() => navigateTo('/assistant2')}>
                    <i className="nav-main-link-icon si si-energy"></i>
                    <span className="nav-main-link-name">Assistant département</span>
                  </a>
                </li>
              )}
              {(userRole.includes('Declarant') || userRole.includes('Chef departement')) && (
                <li className="nav-main-item">
                  <a className="nav-main-link" href="#!" onClick={() => navigateTo('/declarant')}>
                    <i className="nav-main-link-icon si si-energy"></i>
                    <span className="nav-main-link-name">Déclarant</span>
                  </a>
                </li>
              )}
              {(userRole.includes('Livreur') || userRole.includes('Chef departement')) && (
                <li className="nav-main-item">
                  <a className="nav-main-link" href="#!" onClick={() => navigateTo('/livreur')}>
                    <i className="nav-main-link-icon si si-energy"></i>
                    <span className="nav-main-link-name">Livreur</span>
                  </a>
                </li>
